import React, { useState } from "react";
import { Link } from "react-router-dom";

function Home() {
  const [role, setRole] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [loginMsg, setLoginMsg] = useState("");
  // 新增申請帳號狀態
  const [regUser, setRegUser] = useState("");
  const [regPass, setRegPass] = useState("");
  const [regMsg, setRegMsg] = useState("");

  const handleLogin = () => {
    // 这里只做简单演示，实际项目请用后端校验
    if (role === "admin" && username === "admin" && password === "admin123") {
      setLoginMsg("管理者登入成功！");
    } else if (role === "dealer" && username === "dealer" && password === "dealer123") {
      setLoginMsg("通路商登入成功！");
    } else {
      setLoginMsg("帳號或密碼錯誤");
    }
  };

  // 新增申請帳號處理
  const handleRegister = () => {
    if (!regUser || !regPass) {
      setRegMsg("請輸入帳號與密碼");
      return;
    }
    // 這裡僅前端示範，實際應送到後端儲存
    setRegMsg(`帳號 ${regUser} 申請成功，請等待審核`);
    setRegUser("");
    setRegPass("");
  };

  return (
    <div>
      <h2>恆通經銷車用零件管理系統</h2>
      <div style={{ background: "#222", color: "#fff", padding: 24, borderRadius: 8, marginBottom: 24, width: 320 }}>
        <h3>登入</h3>
        <div>
          <label>
            <input type="radio" name="role" value="admin" checked={role === "admin"} onChange={() => setRole("admin")}/> 管理者
          </label>
          <label style={{ marginLeft: 16 }}>
            <input type="radio" name="role" value="dealer" checked={role === "dealer"} onChange={() => setRole("dealer")}/> 通路商
          </label>
        </div>
        <input style={{ marginTop: 12, width: "100%" }} type="text" placeholder="帳號" value={username} onChange={e => setUsername(e.target.value)} />
        <input style={{ marginTop: 12, width: "100%" }} type="password" placeholder="密碼" value={password} onChange={e => setPassword(e.target.value)} />
        <button style={{ marginTop: 16, width: "100%" }} onClick={handleLogin}>登入</button>
        {loginMsg && <div style={{ marginTop: 8 }}>{loginMsg}</div>}
      </div>
      <div style={{ background: "#333", color: "#fff", padding: 24, borderRadius: 8, marginTop: 24, width: 320 }}>
        <h3>申請通路商帳號</h3>
        <div>
          <input
            type="text"
            placeholder="帳號"
            value={regUser}
            onChange={e => setRegUser(e.target.value)}
            style={{ marginBottom: 8, width: "100%" }}
          />
        </div>
        <div>
          <input
            type="password"
            placeholder="密碼"
            value={regPass}
            onChange={e => setRegPass(e.target.value)}
            style={{ marginBottom: 8, width: "100%" }}
          />
        </div>
        <button onClick={handleRegister} style={{ width: "100%" }}>申請</button>
        <div style={{ marginTop: 8 }}>{regMsg}</div>
      </div>
      <Link to="/inventory">進入庫存管理</Link>
      <br />
      <Link to="/admin">
        <button style={{ marginTop: 16 }}>進入後台</button>
        <Link to="/shipping"><button style={{ marginLeft: 16 }}>出貨統計</button></Link>
      </Link>
    </div>
  );
}
export default Home;
